#include <vector>
#include <string>
using namespace std;

class Solution {
public:
    vector<int> lastVisitedIntegers(vector<string>& words) {
        vector<int> lastVisited;
        vector<int> nums;
        int prevCount = 0; // Track consecutive "prev" strings

        for (const auto& word : words) {
            if (word == "prev") {
                ++prevCount; // Increment for each "prev"
                if (prevCount <= nums.size()) {
                    // If there are enough nums, add the (prevCount - 1)th from the end
                    lastVisited.push_back(nums[nums.size() - prevCount]);
                } else {
                    // If not enough nums, add -1
                    lastVisited.push_back(-1);
                }
            } else {
                // Convert string to int and add to nums
                nums.push_back(stoi(word));
                prevCount = 0; // Reset prevCount when a number is encountered
            }
        }

        return lastVisited;
    }
};
